     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<hr style=\"border:1px solid black\" />\n\n<p></p><h4 style=\"text-align:left\">\n<b>IRB#:</b> 00024248</h4><p></p>\n\n\n\n\n<p><br /></p><h3 style=\"text-align:center\"> <b>Research Consent and Authorization Form</b></h3><p></p>\n\n<p style=\"text-align:center;color:black;font-size:16px;margin:0\">\nThe HEALthy Brain and Child Development (HBCD)</p>\n\n<p style=\"text-align:center;color:black;font-size:16px\">Pilot Study</p>\n\n\n<p style=\"text-align:left;color:black;font-size:16px;margin:0\"><b>PRINCIPAL INVESTIGATOR:</b><span style=\"float:right\">Elinor Sullivan, PhD (503) 346-5516</span></p>\n\n<p style=\"text-align:left;color:black;font-size:16px;margin:0\"><b>CO-INVESTIGATORS:</b><span style=\"float:right\">Alice Graham, PhD (503) 494-2537</span></p>\n\n<p style=\"text-align:right;color:black;font-size:16px\">Bonnie Nagel, PhD (503) 494-4612</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\"><b>Introduction</b></p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">Dr. Elinor Sullivan, Dr. Alice Graham, and Bonnie Nagel are conducting a pilot study for research at Oregon Health &amp; Science University, and are asking for your consent for you and your child to participate. The purpose is to help find out if the planned study activities are acceptable and can be completed by future participants. This pilot study will recruit between 10 and 31 pilot participants at each of 25 locations across the United States where the main study will also be done. This section provides a summary of important information. The rest of the form provides additional details. </p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">The purpose of this pilot study is to inform a nation-wide research project that is intended to learn how children grow and change (develop) early in life. We will study children’s thinking, behavior, social interactions, emotions, and brains from birth through 10 years old. The research will look at many factors that might be helpful or harmful to a child’s development. These include exposure to tobacco, alcohol, and other drugs before birth, family members’ mental health and stress, the family’s social and economic environment, the child’s exposure to toxins, and how the parent or caregiver interacts with their child. The overall goal of this study is to better understand how children grow up in different environments. While there is no direct benefit to you from participating, the results of this study may help scientists design new methods for improving the lives of children and their families. </p>"
    },
    {
