    {
     "type": "html",
     "name": "question39",
     "width": "600px",
     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<h4 style=\"text-align:left\"><b><i>\nCan you or your child be withdrawn from the study without your consent?</i></b></h4>\n\n<p style=\"text-align:left;color:black;font-size:16px\">You and your child may be withdrawn from the pilot study if Dr. Sullivan or the HBCD investigators believe it is in your or your child’s best medical interest or if you do not follow the instructions from the study personnel.</p>\n\n\n\n<br /><h4 style=\"text-align:left\"><b><i>\nWill you be compensated for participating in this study?</i></b></h4>\n\n<p style=\"text-align:left;color:black;font-size:16px\">You will be compensated for your and your child’s time participating in the study approximately according to the amount of time required to complete the visit measures and to provide the biological samples. The following compensation schedule applies to the specific activities listed for the pregnancy or infant pilot that you and your child are being asked to do.</p>\n\n\n<table style=\"font-family:arial,sans-serif;border-collapse:collapse;width:100%\">\n\n<tr style=\"border:1px solid #000000;padding:8px;font-size:16px;text-align:center;color:black\">\n\n<td style=\"border:1px solid #000000;padding:2px;width:15%\"><b>Visit</b></td>\n\n<td style=\"border:1px solid #000000;padding:2px\"><b>Timepoint</b></td>\n\n<td style=\"border:1px solid #000000;padding:2px\"><b>Parent/Child</b></td>\n\n<td style=\"border:1px solid #000000;padding:2px;width:30%\"><b>Study activity</b></td>\n\n<td style=\"border:1px solid #000000;padding:2px\"><b>Amount</b></td>\n</tr>\n\n<tr style=\"border:1px solid #000000;padding:8px;font-size:16px;text-align:center;color:black;background-color:lightgray\">\n<td style=\"border:1px solid #000000;padding:2px\"><b>Visit 1</b></td>\n<td style=\"padding:2px\"></td>\n<td style=\"padding:2px\"></td>\n<td style=\"padding:2px\"></td>\n<td style=\"border:1px solid #000000;padding:2px\"><b>Total: $170</b></td>\n</tr>\n\n<tr style=\"border:1px solid #000000;padding:8px;font-size:16px;text-align:center;color:black\">\n\n<td style=\"border:1px solid #000000;padding:2px\"></td>\n\n<td style=\"border:1px solid #000000;padding:2px\">Prenatal</td>\n\n<td style=\"border:1px solid #000000;padding:2px\">\n<table style=\"font-family:arial,sans-serif;border-collapse:collapse;width:100%\">\n<tr><td style=\"border-bottom:1px solid #000000;padding:2px;line-height:15px\">Parent</td></tr>\n<tr><td style=\"border-bottom:1px solid #000000;padding:2px;line-height:50px\">Parent</td></tr>\n<tr><td style=\"line-height:10px;padding-top:4px\">Parent</td></tr>\n</table>\n</td>\n\n<td style=\"border:1px solid #000000;padding:2px\">\n<table style=\"font-family:arial,sans-serif;border-collapse:collapse;width:100%\">\n<tr><td style=\"border-bottom:1px solid #000000;padding:2px\">Questionnaires</td></tr>\n<tr><td style=\"border-bottom:1px solid #000000;padding:2px\">Biospecimens: Urine, blood, saliva</td></tr>\n<tr><td>Wearable Sensors</td></tr>\n</table>\n</td>\n\n<td style=\"border:1px solid #000000;padding:2px\">\n<table style=\"font-family:arial,sans-serif;border-collapse:collapse;width:100%\">\n<tr><td style=\"border-bottom:1px solid #000000;padding:2px;padding-bottom:2px;line-height:15px\">$50</td></tr>\n<tr><td style=\"border-bottom:1px solid #000000;padding:2px;line-height:50px\">$60</td></tr>\n<tr><td style=\"line-height:8px;padding-top:6px\">$60</td></tr>\n</table>\n</td>\n</tr>\n\n<tr style=\"border:1px solid #000000;padding:8px;font-size:16px;text-align:center;color:black;background-color:lightgray\">\n<td style=\"border:1px solid #000000;padding:2px\"><b>Visit 2</b></td>\n<td style=\"padding:2px\"></td>\n<td style=\"padding:2px\"></td>\n<td style=\"padding:2px\"></td>\n<td style=\"border:1px solid #000000;padding:2px\"><b>Total: $240</b></td>\n</tr>\n\n\n<tr style=\"border:1px solid #000000;padding:8px;font-size:16px;text-align:center;color:black\">\n\n<td style=\"border:1px solid #000000;padding:2px\"></td>\n\n<td style=\"border:1px solid #000000;padding:2px\">0-3 Months</td>\n\n<td style=\"border:1px solid #000000;padding:2px\">\n<table style=\"font-family:arial,sans-serif;border-collapse:collapse;width:100%\">\n<tr><td style=\"border-bottom:1px solid #000000;padding:2px;line-height:25px\">Parent</td></tr>\n<tr><td style=\"border-bottom:1px solid #000000;padding:2px;line-height:25px\">Child</td></tr>\n<tr><td style=\"border-bottom:1px solid #000000;padding:2px;line-height:40px\">Child</td></tr>\n<tr><td style=\"border-bottom:1px solid #000000;padding:2px;line-height:40px\">Parent</td></tr>\n<tr><td style=\"border-bottom:1px solid #000000;padding:2px;line-height:20px\">Child</td></tr>\n<tr><td style=\"padding:2px;line-height:20px\">Child</td></tr>\n</table>\n</td>\n\n<td style=\"border:1px solid #000000;padding:2px\">\n<table style=\"font-family:arial,sans-serif;border-collapse:collapse;width:100%\">\n<tr><td style=\"border-bottom:1px solid #000000;padding:2px;line-height:25px\">Questionnaires</td></tr>\n<tr><td style=\"border-bottom:1px solid #000000;padding:2px;line-height:25px\">Physical measures</td></tr>\n<tr><td style=\"border-bottom:1px solid #000000;padding:2px;line-height:20px\">Biospecimens, urine, saliva</td></tr>\n<tr><td style=\"border-bottom:1px solid #000000;padding:2px;line-height:20px\">Biospecimens saliva, nails</td></tr>\n<tr><td style=\"border-bottom:1px solid #000000;padding:2px;line-height:20px\">Wearable Sensors</td></tr>\n<tr><td style=\"padding:2px;line-height:20px\">MRI scan</td></tr>\n</table>\n</td>\n\n<td style=\"border:1px solid #000000;padding:2px\">\n<table style=\"font-family:arial,sans-serif;border-collapse:collapse;width:100%\">\n<tr><td style=\"border-bottom:1px solid #000000;padding:2px;line-height:25px\">$40</td></tr>\n<tr><td style=\"border-bottom:1px solid #000000;padding:2px;line-height:25px\"> </td></tr>\n<tr><td style=\"border-bottom:1px solid #000000;padding:2px;line-height:85px\">$30</td></tr>\n<tr><td style=\"border-bottom:1px solid #000000;padding:2px;line-height:20px\">$60</td></tr>\n<tr><td style=\"padding:2px;line-height:20px\">$110</td></tr>\n</table>\n</td>\n</tr>\n\n<tr style=\"border:1px solid #000000;padding:8px;font-size:16px;text-align:center;color:black;background-color:lightgray\">\n<td style=\"border:1px solid #000000;padding:2px\"><b>Visit 3</b></td>\n<td style=\"padding:2px\"></td>\n<td style=\"padding:2px\"></td>\n<td style=\"padding:2px\"></td>\n<td style=\"border:1px solid #000000;padding:2px\"><b>Total: $330</b></td>\n</tr>\n\n<tr style=\"border:1px solid #000000;padding:8px;font-size:16px;text-align:center;color:black\">\n\n<td style=\"border:1px solid #000000;padding:2px\"></td>\n\n<td style=\"border:1px solid #000000;padding:2px\">3-15 Months</td>\n\n<td style=\"border:1px solid #000000;padding:2px\">\n<table style=\"font-family:arial,sans-serif;border-collapse:collapse;width:100%\">\n<tr><td style=\"border-bottom:1px solid #000000;padding:2px;line-height:25px\">Parent</td></tr>\n<tr><td style=\"border-bottom:1px solid #000000;padding:2px;line-height:25px\">Child</td></tr>\n<tr><td style=\"border-bottom:1px solid #000000;padding:2px;line-height:25px\">Child</td></tr>\n<tr><td style=\"border-bottom:1px solid #000000;padding:2px;line-height:50px\">Child</td></tr>\n<tr><td style=\"border-bottom:1px solid #000000;padding:2px;line-height:25px\">Parent</td></tr>\n<tr><td style=\"border-bottom:1px solid #000000;padding:2px;line-height:25px\">Child</td></tr>\n<tr><td style=\"border-bottom:1px solid #000000;padding:2px;line-height:25px\"> </td></tr>\n<tr><td style=\"padding:2px;line-height:25px\">Child</td></tr>\n</table>\n</td>\n\n<td style=\"border:1px solid #000000;padding:2px\">\n<table style=\"font-family:arial,sans-serif;border-collapse:collapse;width:100%\">\n<tr><td style=\"border-bottom:1px solid #000000;padding:2px;line-height:25px\">Questionnaires</td></tr>\n<tr><td style=\"border-bottom:1px solid #000000;padding:2px;line-height:25px\">Testing/questionnaire</td></tr>\n<tr><td style=\"border-bottom:1px solid #000000;padding:2px;line-height:25px\">Physical measures</td></tr>\n<tr><td style=\"border-bottom:1px solid #000000;padding:2px;line-height:25px\">Biospecimens, urine, saliva, stool</td></tr>\n<tr><td style=\"border-bottom:1px solid #000000;padding:2px;line-height:25px\">Biospecimens saliva</td></tr>\n<tr><td style=\"border-bottom:1px solid #000000;padding:2px;line-height:25px\">Wearable Sensors</td></tr>\n<tr><td style=\"border-bottom:1px solid #000000;padding:2px;line-height:25px\">MRI scan</td></tr>\n<tr><td style=\"padding:2px;line-height:25px\">EEG</td></tr>\n</table>\n</td>\n\n<td style=\"border:1px solid #000000;padding:2px\">\n<table style=\"font-family:arial,sans-serif;border-collapse:collapse;width:100%\">\n<tr><td style=\"border-bottom:1px solid #000000;padding:2px;line-height:25px\">$30</td></tr>\n<tr><td style=\"border-bottom:1px solid #000000;padding:2px;line-height:25px\">$40 </td></tr>\n<tr><td style=\"border-bottom:1px solid #000000;padding:2px;line-height:25px\"> </td></tr>\n<tr><td style=\"border-bottom:1px solid #000000;padding:2px;line-height:80px\">$40</td></tr>\n<tr><td style=\"border-bottom:1px solid #000000;padding:2px;line-height:25px\">$60</td></tr>\n<tr><td style=\"border-bottom:1px solid #000000;padding:2px;line-height:25px\">$110</td></tr>\n<tr><td style=\"padding:2px;line-height:25px\">$50</td></tr>\n</table>\n</td>\n</tr>\n\n</table>\n\n<br />\n"
