     "type": "html",
     "name": "question22",
     "width": "600px",
     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<p style=\"text-align:left;color:black;font-size:16px\">You may receive payment via a debit card. There may be fees (for example, if the card is inactive for more than six months), which will be deducted from the balance on your card. Details on how to use the card and any fees are included in the separate card member agreement and FAQ sheet.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">Payment received as compensation for participation in research is considered taxable income for a research subject.  If payments are more than $600 in any one calendar year, OHSU is required to report this information to the Internal Revenue Service (IRS).  Research subject payments exceeding $600 during any calendar year will result in a 1099 (Miscellaneous Income) form being issued to the research subject and a copy will be sent to the IRS. We will also reimburse you for transportation if needed for study visits, and will provide you with access to food, and other small gifts such as diapers or a book or toy. If you move out of the study area for a certain site, you will be given the option to transition to another study site closer to your new location.</p>\n\n<h4 style=\"text-align:left\"><b><i>\nAre there any costs associated with participating in this study?</i></b></h4>\n\n<p style=\"text-align:left;color:black;font-size:16px\">There will be no cost to you for participating in this study.</p>\n\n\n\n<br /><h4 style=\"text-align:left\"><b><i>\nWhat if you or your child are injured as a direct result of being in this study?</i></b></h4>\n\n<p style=\"text-align:left;color:black;font-size:16px\">If you believe you have been injured or harmed as a result of participating in this research and require treatment, contact the HBCD study team at 503-418-9334.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">If you are injured or harmed by study procedures you will be treated.  OHSU does not offer any financial compensation or payment for the cost of treatment if you are injured or harmed as a result of participating in this research.  Therefore, any medical treatment you need may be billed to you or your insurance.  However, you are not prevented from seeking to collect compensation for injury related to negligence on the part of those involved in the research.  Oregon law (Oregon Tort Claims Act (ORS 30.260 through 30.300)) may limit the dollar amount that you may recover from OHSU or its caregivers and researchers for a claim relating to care or research at OHSU, and the time you have to bring a claim. If you have questions on this subject, please call the OHSU Research Integrity Office at (503) 494-7887.</p>\n\n"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
  },
  {
   "name": "page14",
   "elements": [
    {
     "type": "html",
     "name": "question30",
     "width": "600px",
     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<h4 style=\"text-align:left\"><b><i>\nWhat about your and your child’s confidentiality?</i></b></h4>\n\n<p style=\"text-align:left;color:black;font-size:16px;margin:0\">We will create and collect health information about your child as described in the <b><i>Introduction</i></b> and the <b><i>What will happen to you in this study?</i></b> and <b><i>Which procedures are standard of care and which are experimental?</i></b> sections of this form.  By agreeing to your child being in this study, you are giving permission (also called authorization) for us to use and disclose your and your child's health information as described in this form.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px;margin:0\">Research records will be kept confidential to the extent allowed by law. This means what you tell us is not shared outside of the HBCD investigators and study team. Your records and your child’s records with your and your child’s name and contact information will be stored separately from data collected from you in a secure password protected computer file with access restricted to limited study personnel.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">The investigators, study staff, and others at OHSU may use the information we collect and create about you in order to conduct and oversee this research study.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">We may release this information to others outside of OHSU who are involved in conducting or overseeing research, including:</p>\n\n<ul style=\"font-size:16px;color:black\">\n<li>the National Institute of Health (NIH)</li>\n<li>Other HBCD Investigators</li>\n<li>The Office for Human Research Protections, a federal agency that oversees research involving humans</li>\n<li>HIPAA-compliant project management platforms (Ripple and Loris) that support the study's collection, analysis and management of data, and maintain participant health information in a secure and confidential manner for the length of the study.</li>\n</ul>\n\n<p style=\"text-align:left;color:black;font-size:16px\">Those listed above may also be permitted to review and copy your records.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">Research records may be reviewed by the UCSD and local site Institutional Review Boards and the people who support this study at the National Institutes of Health.</p>\n\n\n"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
  },
  {
   "name": "page22",
   "elements": [
    {
     "type": "html",
     "name": "question73",
     "maxWidth": "600px",
     "html": "<p style=\"text-align:left;color:black;font-size:16px\">All results of your and your child’s information (for example, your responses to interviews and questionnaires) will be identified only by a unique participant code that contains no information about your or your child’s identity. Only the research team will have the information that matches the code to your identifying information, such as your or your child’s name, address and phone number. Drs. Sullivan, Graham, and Nagel and their staff will keep the information that matches the code to this identifying information in a password database for approximately 15 years or as long as the study has funding. Only very few authorized people, who have agreed to protect your and your child’s identity, will have access to this information that matches your and your child’s personal information to your unique code.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">In this coded form, the data will be entered into a database. This database will be accessible to the HBCD study researchers, and the data will also be placed in data repositories that are maintained or sponsored by the National Institutes of Health. The data will be made available broadly for research and development of new methods. This information may ultimately have significant therapeutic or commercial value. By agreeing for yourself and your child to participate in this study, you agree to such uses. Researchers who request access to your and your child’s data will have to agree not to try to identify individuals who have participated in the study. However, there is a small possibility that in the future an unauthorized attempt to identify you or your child as participants in the study could succeed. </p>"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
  },
  {
   "name": "page15",
   "elements": [
    {
     "type": "html",
     "name": "question31",
     "width": "600px",
     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<p style=\"text-align:left;color:black;font-size:16px\">This research is covered by a Certificate of Confidentiality from the National Institutes of Health (NIH). Researchers with this Certificate may not disclose or use information, documents, or biological samples that may identify you or your child in any federal, state, or local civil, criminal, administrative, legislative, or other action, suit, or proceeding. Researchers may not disclose of use the information, documents, or biological samples as evidence unless you have consented for this use. Information, documents, or biological samples protected by this Certificate cannot be disclosed to anyone else who is not connected with the research unless there is a federal, state, or local law that requires disclosure (such as to report child abuse, elder abuse, intent to hurt self or others, or communicable diseases), you have consented to the disclosure, including for your or your child’s medical treatment; or it is used for other scientific research, as allowed by federal regulations protecting research subjects.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">We may need to report information about known or reasonably suspected incidents of abuse or neglect of a child or elder including physical, sexual, emotional, and financial abuse or neglect. If anyone on the research team has or is given such information, they will be required to report such information to the appropriate authorities.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">If you or your child report intention to harm yourself or others to the research team, this will require a referral or report to the appropriate authorities. </p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">The Certificate cannot be used to refuse a request for information from personnel of federal or state government agency sponsoring the project that is needed for auditing or program evaluation by the National Institutes of Health which is funding the project. You should also understand that a Certificate of Confidentiality does not prevent you from voluntarily releasing information about yourself and your child or your and your child’s involvement in this research. If you want your or your child’s research information released to an insurer, medical care provider, or any other person not connected with the research, you must provide consent to allow the research to release it. </p>"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
  },
  {
   "name": "page16",
   "elements": [
    {
     "type": "html",
     "name": "question32",
     "width": "600px",
     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<p style=\"text-align:left;color:black;font-size:16px\">Under Oregon law, suspected child or elder abuse must be reported to appropriate authorities. If you or your child report intention to harm yourself or others to the research team, this will require a referral or report to the appropriate authorities.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">The law provides additional confidentiality protection for certain types of information, including drug and alcohol diagnosis, treatment, or referral information and mental health records.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">Information about the study, including study appointments may be conveyedto you by text messaging. Text messages are not secure i.e. encrypted in transit, so there is a risk, however slight, that the information sent to you could be read by someone that is not authorized to view the message. The text messages from the study staff will not mention you individually except by first name, and will only include necessary information to coordinate appointments, visits or to coordinate surveys. If you do not wish to receive texts you may opt out and receive messages another way, such as only by phone. Please contact a study team member if you choose not to receive texts. Otherwise, in agreeing to participate in this pilot study you accept the risk associated with using this communication tool. Standard text message rates may apply which will not be covered by the study.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">If you agree to genetic uses of your or your child’s biological samples, Federal and State laws generally make it illegal for health insurance companies, group health plans, and most employers to discriminate against you or your child based on your or your child’s genetic information. This law generally will protect you and your child in the following ways: a) Health insurance companies and group health plans may not request your or your child’s genetic information that we get from this research. b) Health insurance companies and group health plans may not use your or your child’s genetic information when making decisions regarding your or your child’s eligibility or premiums. c) Employers with 5 or more employees may not use your or your child’s genetic information that we get from this research when making a decision to hire, promote, or fire you or your child or when setting the terms of your employment.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">Be aware that these laws <b>do not</b> protect you or your child against genetic discrimination by companies that sell life insurance, disability insurance, or long-term care insurance.</p>\n\n"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
  },
  {
   "name": "page17",
   "elements": [
    {
     "type": "html",
     "name": "question34",
     "width": "600px",
     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<p style=\"text-align:left;color:black;font-size:16px\">Personal identifiers will be removed from the information collected as part of the research. After such removal, the information could be used for future research studies or distributed to another investigator for future research studies without your additional informed consent. If you consented to any of the uses of your or your child’s biological samples, this information could also be used for future research studies or distributed to other investigators for future research studies without your additional informed consent.  </p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">Biological samples (such as blood, saliva, urine, nails or stool) collected from you and your child for this study and/or information obtained from your or your child’s biological samples may be used in this research or other research and shared with other organizations. You will not share in any commercial value or profit derived from the use of your biospecimens and/or information obtained from them.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">When we send specimens or informationoutside of OHSU, they may no longer be protected under federal or Oregon law.  In this case, your specimens or information could be used and re-released without your permission.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">The biological samples will be sent to storage facility (repository) and one or more laboratories. All pilot samples from participants at all HBCD study sites will go to the same HBCD study repository.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">The study laboratory may analyze your and your child’s samples to evaluate proteins, tobacco, alcohol and other drugs you may have used (including illegal drugs), toxins, environmental exposures, normal bacteria in the gut, and nutrition (the “planned study analyses”). <b>Your samples will NOT have your name or contact information on them when they go to the study repository or laboratory.</b> They will only have a code number. In order to protect against possible legal risks, the results of these tests will not be returned to the research team at your site, so they will not know the individual results for you or your child.</p>\n\n"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
  },
  {
   "name": "page18",
   "elements": [
    {
     "type": "html",
     "name": "question18",
     "width": "600px",
     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<p style=\"text-align:left;color:black;font-size:16px\">The study repository will store your samples so that other evaluations may be done in the future. For instance, in the future we plan to study your DNA (your genes or your whole genome) and some chemicals that turn your genes on and off (epigenetics). We will not do that research now, but we or somebody else may do it in the future.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">The repository can save your samples for many years so that researchers (including researchers who are not part of the HBCD study) could use them for other future research. We do not know what that other research would be. </p>\n\n<p style=\"text-align:left;color:black;font-size:16px\"> You and your child can still take part in the pilot study if you do not agree to the options below. You can change your mind at any time about these options or about the study as a whole.</p>"
