     "html": "<h4 style=\"text-align:left\"><b>\nWill you receive any results about yourself or your child from participating in this study?</b> </h4>\n\n<p style=\"text-align:left;color:black;font-size:16px\">While the study will not provide medical care, if the answers you give us in some of the questionnaires suggest that you are having serious problems with your mental health, we will let you know, and assist you in finding help.  If there is something the study doctors notice when looking at your child’s MRI scan that might need further evaluation, we will let you know and assist you in deciding what you can do next. Your participation in this study may be placed in your OHSU or Hillsboro Medical Center (HMC) medical record</p>"
