     "html": "<h4 style=\"text-align:left\"><b><i>Who can you call if you have questions?</i></b></h4>\n\n<p style=\"text-align:left;color:black;font-size:16px\">This study has been explained to you and your questions have been answered. If you have other questions or research-related problems, you may reach Dr. Sullivan at sullivel@ohsu.edu, or (503) 346-5516.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">This research has been approved and is overseen by an Institutional Review Board (“IRB”), a committee that protects the rights and welfare of research subjects. You may talk to the IRB at (503) 494-7887 or irb@ohsu.edu if:</p>\n\n<ul style=\"font-size:16px;color:black\">\n<li>Your questions, concerns, or complaints are not being answered by the research team.</li>\n<li>You want to talk to someone besides the research team.</li>\n<li>You have questions about your or your child's rights as a research subject.</li>\n<li>You want to get more information or provide input about thisresearch.</li>\n</ul>\n\n<p style=\"text-align:left;color:black;font-size:16px\">You may also submit a report to the OHSU Integrity Hotline online at https://secure.ethicspoint.com/domain/media/en/gui/18915/index.htmlor by calling toll-free (877) 733-8313 (anonymous and available 24 hours a day, 7 days a week).</p>"
